const delay = (t: number) => new Promise((r) => setTimeout(r, t))

export type Theme = 'outline' | 'filled' | 'two-tone' | 'multi-color';
export interface IconSpaceProps{
  strokeWidth: number
  size: number
  theme: Theme
  colors: string | string[]
  strokeLinejoin: string
  strokeLinecap: string
}

export const useCounter = defineStore('counter', {
  state: ():{

  } => ({
    iconConfig: {
      strokeWidth: 2,
      size: 24,
      theme: 'multi-color',
      colors: ['#666', '#2F88FF', '#FFF', '#43CCF8'],
      strokeLinejoin: 'miter',
      strokeLinecap: 'square'
    }
  }),

  actions: {
    increment(amount = 1) {
      this.incrementedTimes++
      this.n += amount
    },

    changeMe() {
      console.log('change me to test HMR')
    },

    async fail() {
      const n = this.n
      await delay(1000)
      this.numbers.push(n)
      await delay(1000)
      if (this.n !== n) {
        throw new Error('Someone changed n!')
      }

      return n
    },

    async decrementToZero(interval: number = 300) {
      if (this.n <= 0) return

      while (this.n > 0) {
        this.$patch((state) => {
          state.n--
          state.decrementedTimes++
        })
        await delay(interval)
      }
    },
  },
})

if (import.meta.hot) {
  import.meta.hot.accept(acceptHMRUpdate(useCounter, import.meta.hot))
}
